extern volatile unsigned int repeatCounter;
extern volatile unsigned int btnPressedCounter;
extern volatile unsigned int sequenceNoteDurationCounter;
static volatile unsigned int repeatCounterMultiplier;
extern volatile unsigned int glissCounter;

ISR(TIMER0_COMPA_vect)
{
  lfoCounter+=freqMultiplier;
  if(lfoCounter>=TABLE_SIZE){
    lfoCounter=lfoCounter - TABLE_SIZE;
  }

  switch(waveType)
  {
    case LFO_WAVE_TYPE_SINE:
      OCR2B = pgm_read_byte_near(SINETABLE + lfoCounter );
      break;
    case LFO_WAVE_TYPE_TRIANGLE:
      OCR2B = pgm_read_byte_near(TRIANGLETABLE + lfoCounter );
      break;
    case LFO_WAVE_TYPE_EXP:
      OCR2B = pgm_read_byte_near(EXPTABLE + lfoCounter );
      break;
    case LFO_WAVE_TYPE_SQUARE:
      if(lfoCounter<(TABLE_SIZE/2))
        OCR2B = 255;
      else
        OCR2B = 0;
      break;
  }
  //Serial.print(OCR2A,DEC);
  //Serial.print("\r\n");

  
  repeatCounterMultiplier++;
  if(repeatCounterMultiplier>=40) // 25ms
  {
    repeatCounterMultiplier=0;
    repeatCounter++;
    btnPressedCounter++;
    sequenceNoteDurationCounter++;
  }

  glissCounter++;
  
}



void lfo_init(void)
{
    waveType=LFO_WAVE_TYPE_SINE;
    lfoCounter=0;
    freqMultiplier=30;  // from 1 to 60 for 0.5Hz to 30Hz
    repeatCounterMultiplier=0;
    repeatCounter=0;
}

void lfo_setWaveType(unsigned char type)
{
    waveType = type;
}

/**
 * fm: 0 to 1023
 */
void lfo_setFrequencyMultiplier(unsigned int fm)
{   
    freqMultiplier = pgm_read_byte_near(FMULTI_POT_TABLE + (fm>>2) );    
}

void lfo_reset(void)
{
    lfoCounter=0;
}






